import { getArray } from "../../../hooks/usePagination";
import { useGetProductsQuery } from "../../../store/servises";




export const Pagination = ({count}) => {
  const { data } = useGetProductsQuery(count);



  return (
    <div >
      {data && getArray(data.total/count).map(p=>  <button className="outline" key={p}> {p} </button>)}
   </div>
  );
};
